        if(this.state.posts === null){
            this.getPosts();

        }

    }

    getPosts = () => {
        let endpoint = 'https://jsonplaceholder.typicode.com/posts';

        axios.get('https://jsonplaceholder.typicode.com/posts')
            .then(res => {
                this.setState({
                    posts: res.data,
                    status: 'success'
                });

            }).catch(err =>{
                this.setState({
                    posts: [],
                    status: 'failed'
                });
            });
    };

